import React, { useState } from "react";
const Cam = (props) => {
  return (
    <div class="h-1/3 w-1/3 ">
      {props.isPaused ? (
        <div>Video Paused</div>
      ) : (
        <img
          className="rounded-2xl drop-shadow-2xl"
          src="http://localhost:5000/api/video_feed"
          alt="Video"
        />
      )}
    </div>
  );
};
export default Cam;
